import styles from './Header.module.scss';
import { Link } from 'react-router-dom';

function Header() {
	return (
		<header className={styles.wrapper}>
			<div className={styles.logo}>
				<a href="/" ></a>
			</div>
			<div className={styles.profileWrapper}>
				<p>Profile</p>
			</div>
		</header>
	);
}

export default Header;
